//地区操作方法
var area = {
	idName:'',
	//初始化方法
	//idName是select表单的id名称
	init:function(idName){
		this.idName = idName;
		//当前的json
		var _this = this;
		//防止多次调用多次循环
		if(typeof firstOption == 'undefined'){
			firstOption = '<option value="0" areaid=0>请选择省</option>';
			//找到所有的一级地区
			firstOption += _this.getOption(1);
		}

		for (var i = 1; i <= 3; i++) {
			var idNewName = '#' + this.idName + i;
			switch(i){
				case 1:
					//一级地区，初始化option
					$(idNewName).html(firstOption);
					break;
				case 2:
					$(idNewName).html('<option value="0" areaid=0>请选择市</option>');
					break;
				case 3:
					$(idNewName).html('<option value="0" areaid=0>请选择县</option>');
					break;
			}

			//所有的select选中事件
			$(idNewName).change(function(){
				//触发当前的change事件
				_this.change($(this).find('option:selected').attr('areaid'),$(this));
			})
		};

	},
	//切换地区时的动作
	change:function(areaId,thisObj){
		//获得选中第几个select
		var idName = thisObj.attr('id');
		var num = idName.substr(-1,1);
		//下一个select的option
		var option = this.getOption(areaId);
		//点击第一个select的时候
		if(num == 1){
			if(areaId == 0){
				option = '<option value="0" areaid=0>请选择市</option>';
			}
			//让第二个显示第一个的子集
			thisObj.next('select').html(option);
			//第三个显示第二个的子集
			var id = $(option).first().attr('areaid');
			if(id == 0){
				option = '<option value="0" areaid=0>请选择县</option>';
			}else{
				option = this.getOption(id);
			}
			thisObj.next('select').next('select').html(option);
		}
		//点击第二个，操作第三个select
		if(num ==2){
			thisObj.next('select').html(option);
		}

	},
	//修改的时候 选中的方法
	selected:function(first,second,third){
		var firstId = this.getAreaId(first);
		//让第一个选中
		var firstObj = $('#' + this.idName + 1);
		firstObj.find('option[areaid='+firstId+']').attr('selected',true);
		this.change(firstId,firstObj);
		//第二个选中
		var secondId = this.getAreaId(second);
		var secondObj = $('#' + this.idName + 2);
		secondObj.find('option[areaid='+secondId+']').attr('selected',true);
		this.change(secondId,secondObj);
		//第三个选中
		var thirdId = this.getAreaId(third);
		$('#' + this.idName + 3).find('option[areaid='+thirdId+']').attr('selected',true);

	},
	//通过城市名称获得城市id
	getAreaId:function(areaName){
		for(var i in areaData){
			if(areaData[i].area_name == areaName){
				return areaData[i].area_id;
			}
		}
		return 0;
	},
	//获得option
	getOption:function(id){
		var option = '';
		var _this = this;
		$.each(areaData,function(k, v) {
			if(v.parent_id == id){
				option += '<option value="'+v.area_name+'" areaid="'+v.area_id+'">'+v.area_name+'</option>';
			}
		});
		return option;
	}

}









